package note.deadPerson.member;public class Member {    private long id;    private String name;    private Grade grdae;    public Member(long id, String name, Grade grdae) {        this.id = id;        this.name = name;        this.grdae = grdae;    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Grade getGrdae() {        return grdae;    }    public void setGrdae(Grade grdae) {        this.grdae = grdae;    }}